import { StatusBar } from "expo-status-bar"
import {Button, StyleSheet, Text, View, FlatList} from "react-native"



export default function Odenes(){
    const DATA = [
        {
          id: '001',
          Cliente: 'Juan',
          status:'Preparacion'
        },
        {
          id: '002',
          cliente: 'luis',
          status: 'entregado'
        },
        {
          id: '003',
          cliente: 'Maria',
          status:'preparacion'
        },
    ];
    return(
        <View>
            <Button title="Nueva Orden" onPress={() => navigation.navigate("Nuevo")} />
            <FlatList
                data={DATA}
                
            />
        </View>
    );
}
